def Power(x,n):
	return x**n
def Sqrt(x):
	return np.sqrt(x)
def lam(a,b,c):
	return a**2 + b**2 + c**2 -2*a*b - 2*b*c - 2*a*c

def HNL_flux(E):
	EN,flux = np.genfromtxt('digitized/T2K_HNL_fluxes/m4_150_MeV_KmuN.dat',unpack=True)
	return np.interp(E,EN,flux,left=0,right=0)


